import { Link } from "react-router-dom";

import { useLocation } from 'react-router-dom'

function NavItem(props){

  const location = useLocation();
return(
    <Link to={props.route}>
      <div className={location == props.route? "nav-item": ""}>
    <p>{props.text}</p>
</div>
    </Link>);
}


export default NavItem;
